const img = new Image();
img.src = 'data:image/png;base64,';

img.addEventListener('load', () => {
    const canvas = document.getElementById('canv');
    const ctx = canvas.getContext('2d');
    canvas.width = document.getElementById('canv').width;
    canvas.height = document.getElementById('canv').height;
    ctx.drawImage(img, 0, 0, canvas.width, canvas.height);

    let particles = [];
    const particleCount = 3000;

    let switcher = 1;
    let counter = 0;
    setInterval(function(){
        counter++;
        if (counter % 15 === 0) {
            switcher *= -1;
        }
    }, 500);

    let imgData = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    let imageMap = [];
    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            let i = (y * 4) * canvas.width + x * 4;
            let r = imgData.data[i];
            let g = imgData.data[i + 1];
            let b = imgData.data[i + 2];
            const brightness = calcRelativeBrightness(r, g, b);
            const cell = [
                cellBrightness = brightness,
                cellColor = 'rgb(' + r + ',' + g + ',' + b + ')',
            ];
            row.push(cell);
        }
        imageMap.push(row);
    }

    function calcRelativeBrightness(r, g, b) {
        return Math.sqrt((r * r) * 0.299 + 
        (g * g) * 0.587 + 
        (b * b) * 0.114) 
        / 100;
    };


    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.size = Math.random() * .5 + .5;
            this.speed = 0;
            this.velocity = Math.random() * .5;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.angle = 0;
            this.blend = 1;
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            if (imageMap[this.position1] && imageMap[this.position1][this.position2]) {
                this.speed = imageMap[this.position1][this.position2][0];
            }
            // else {
            //     this.speed = 0;
            //     this.size = 0;
            // }
            if (switcher === 1) {
                ctx.globalCompositeOperation = 'lighter';
            } else {
                ctx.globalCompositeOperation = 'luminosity';
            }
              
            // ctx.globalCompositeOperation = 'lighter';
            // Gives the particles a random velocity
            let movement = (3.5 - this.speed) + this.velocity / 2;
            this.angle += this.speed/15;
            this.size = this.speed / 1.5;

            // Moves the particles in a wave-like motion
            this.y += movement + Math.sin(this.angle) * 3;
            this.x += movement + Math.sin(this.angle) * 2;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            if (this.x >= canvas.width) {
                this.x = 0;
                this.y = Math.random() * canvas.height;
            }
        }
        draw() {
            ctx.beginPath();
            if (imageMap[this.position1] && imageMap[this.position1][this.position2]) {
                ctx.fillStyle = imageMap[this.position1][this.position2][1];
                // ctx.strokeStyle = imageMap[this.position1][this.position2][1];
            };

            // ctx.strokeRect(this.x, this.y, this.size * 2, this.size * 2);
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }
    function init() {
        for (let i = 0; i < particleCount; i++) {
            particles.push(new Particle());
        }
    }
    init();
    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0, 0, 0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particles.length; i++) {
            particles[i].update();
            ctx.globalAlpha = particles[i].speed * 0.5;
            particles[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});